MENUES2 PROC NEAR
	                              CALL CLEAR_SCREEN
	                              MOV  AH,02H                       	;move cursor to X,Y position
	                              MOV  DL,6                         	;X-position of the message
	                              MOV  DH,8                         	;Y-position of the message
