DRAW_CENTER PROC near
	                              mov  cx,0a0h                      	;Column
	                              mov  bx,0                         	; rows
	increase_WITH_NO_DRAW:        
	                              inc  bx
	draw_center_oa:               
	                              mov  ax,bx
	                              mov  cx,20
	                              mov  dx,0
